import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import logo from './logo.svg'

function Header() {
    return (
      <header className="main_header">
        <div className="container">
        <div className="row">
          <div className="col-md-3">
            <img src="{logo}" alt="" />
          </div>
        </div>
        </div>
      </header>
    );
  }
  
  export default Header;
